import styled from 'styled-components/native';

export const LogisticContainer = styled.View`
  width: 100%;
  display: flex;
  align-items: center;
  background: #000;
  justify-content: center;
`;

export const LogisticPrimary = styled.Text`
   margin-top: 1rem;
   color: #fff;
   text-align: center;
   font-size: 2rem;
   font-weight: bold;
`;
